<script>
    var x = ['3',
        '9 2',
        '4 5 2 5 4 3 1 3 4',
        '9 4',
        '4 5 2 5 4 3 1 3 4',
        '10 2',
        '5 4 3 2 1 1 2 3 4 5']
    var tong = []
    var length = x[0];
    var tmptmp= 1
    for(let i =0;i < length;i++){
        repeat_number = x[tmptmp++].split(" ")[1]
        arr = x[tmptmp++].split(" ")
        var tmp = []
        for (let i = 0 ; i <arr.length;i++){
            let tam = 0;
            for(let j = 0; j<arr.length;j++){
                tam += (arr[i]==arr[j])?1:0
            }

            if(tam >= repeat_number){
                if(!tmp.includes(arr[i])){
                    tmp.push(arr[i])
                }   
            }
        }
        if(tmp==""){
            tmp[0]='-1'
        }
        tong.push(tmp.join(" "))
    }

    console.log(tong.join(" \n"));



</script>
